import React from "react";
import logo from "../images/aranyagiri1.png";

const Header = () =>
{
    return(
            <div className= "ui segment" style={{color:"red",border:"1px red solid"}}>


                        <div class="ui stackable three column grid center" >

                            <div class="three wide column">    
                                <img className="ui small image" src={logo} alt="Header" style={{border:"1px red solid"}}/> 
                            </div>

                            <div class="three wide column"> 
                                <div class="ui huge label" >
                                    अरण्यगिरी फार्म हाऊस
                                </div>                        
                            </div>

                            <div class="three wide column"> 
                                <button class="medium ui button">
                                    Bookings
                                </button>
                            </div>
                              
                </div>
            </div>
    );
};

export default Header;
